e loader system in whichever module bundler we are using(Webp','{\"blocks\": [{\"key\": \"d1744\", \"data\": {}, \"text\": \"Using image tag for static SVGs\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 31, \"offset\": 0}]}, {\"key\": \"c5h5d\", \"data\": {}, \"text\": \"In order to be able to use SVGs or any other image format in the img <img src={} /> we have to set up a file loader system in whichever module bundler we are using(Webpack, Parcel, etc). Here I will show you how to set it up in a few steps if you are already using Webpack.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 14, \"offset\": 69}]}, {\"key\": \"4am9g\", \"data\": {}, \"text\": \"First, we install the file-loader library $ npm install file-loader --save-dev, this will install it as a dev-dependency.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 36, \"offset\": 42}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 08:29:33','2021-12-21 08:29:33',NULL,NULL,NULL,NULL,NULL,'live'),(176,1,'260e6998-6238-11ec-9947-9c7bef452e53','Test','Using image tag for static SVGs\nIn order to be able to use SVGs or any other image format in the img <img src={} /> we have to set up a file loader system in whichever module bundler we are using(Webp','{\"blocks\": [{\"key\": \"d1744\", \"data\": {}, \"text\": \"Using image tag for static SVGs\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 31, \"offset\": 0}]}, {\"key\": \"c5h5d\", \"data\": {}, \"text\": \"In order to be able to use SVGs or any other image format in the img <img src={} /> we have to set up a file loader system in whichever module bundler we are using(Webpack, Parcel, etc). Here I will show you how to set it up in a few steps if you are already using Webpack.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 14, \"offset\": 69}]}, {\"key\": \"4am9g\", \"data\": {}, \"text\": \"First, we install the file-loader library $ npm install file-loader --save-dev, this will install it as a dev-dependency.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 36, \"offset\": 42}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 08:29:43','2021-12-21 08:29:43',NULL,NULL,NULL,NULL,NULL,'live'),(177,1,'5e54e81a-625b-11ec-9947-9c7bef452e53','What a Story','When you sit down to read Italo Calvino\'s If on a winter\'s night a traveler, you quickly discover that this book is about, well, you sitting down to read If on a winter\'s night a traveler. Written in','{\"blocks\": [{\"key\": \"3t8eq\", \"data\": {}, \"text\": \"When you sit down to read Italo Calvino\'s If on a winter\'s night a traveler, you quickly discover that this book is about, well, you sitting down to read If on a winter\'s night a traveler. Written in the second person, the book addresses \\\"you, the Reader\\\" as its main character, just like in those old Choose Your Own Adventure novels. Back when the book was published in 1979, this was a highly experimental style of narration. And you know what? It kind of blows our minds even today.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 25, \"offset\": 302}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 33, \"offset\": 154}]}], \"entityMap\": {\"0\": {\"data\": {\"rel\": \"noopener\", \"url\": \"http://www.cyoa.com/\", \"href\": \"http://www.cyoa.com/\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,0,0,0,0,0,'2021-12-21 12:41:50','2021-12-21 12:41:50',NULL,NULL,NULL,NULL,NULL,'live'),(178,1,'37a8bf3b-625c-11ec-9947-9c7bef452e53','Time\'s Up','Once you\'ve figured out that you\'re going to be the main character, things get crazy. Due to a printer\'s error, the story gets majorly interrupted. And then, to make up for this inconvenience, the boo','{\"blocks\": [{\"key\": \"filr6\", \"data\": {}, \"text\": \"Once you\'ve figured out that you\'re going to be the main character, things get crazy. Due to a printer\'s error, the story gets majorly interrupted. And then, to make up for this inconvenience, the book just goes ahead and does this to you ten more times, leading you through a plot that involves corrupt dictators, a torturous romance, and a worldwide book conspiracy.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 14, \"offset\": 239}]}, {\"key\": \"apmf\", \"data\": {}, \"text\": \"In order to tie this all together, the book is divided into twenty-two parts; every odd-numbered section describes your worldwide quest to finish the many books you\'ve started reading, and every even-numbered section is the first chapter of one of these fictional books. Confused yet? Good.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 12:47:55','2021-12-21 12:47:55',NULL,NULL,NULL,NULL,NULL,'live'),(179,1,'b155a8ad-625c-11ec-9947-9c7bef452e53','The END','Congratulations! This was a long page, but hopefully by the end most of your questions about effects were answered. You’ve learned both the State Hook and the Effect Hook, and there is a lot you can d','{\"blocks\": [{\"key\": \"8790l\", \"data\": {}, \"text\": \"Congratulations! This was a long page, but hopefully by the end most of your questions about effects were answered. You’ve learned both the State Hook and the Effect Hook, and there is a lot you can do with both of them combined. They cover most of the use cases for classes — and where they don’t, you might find the additional Hooks helpful.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 16, \"offset\": 318}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 3, \"offset\": 187}]}, {\"key\": \"evqqb\", \"data\": {}, \"text\": \"We’re also starting to see how Hooks solve problems outlined in Motivation. We’ve seen how effect cleanup avoids duplication in componentDidUpdate and componentWillUnmount, brings related code closer together, and helps us avoid bugs. We’ve also seen how we can separate effects by their purpose, which is something we couldn’t do in classes at all.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 10, \"offset\": 64}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 18, \"offset\": 128}, {\"style\": \"CODE\", \"length\": 20, \"offset\": 151}]}, {\"key\": \"338og\", \"data\": {}, \"text\": \"At this point you might be questioning how Hooks work. How can React know which useState call corresponds to which state variable between re-renders? How does React “match up” previous and next effects on every update? On the next page we will learn about the Rules of Hooks — they’re essential to making Hooks work.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 2, \"length\": 14, \"offset\": 260}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 8, \"offset\": 80}, {\"style\": \"BOLD\", \"length\": 97, \"offset\": 219}]}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://reactjs.org/docs/hooks-reference.html\", \"href\": \"https://reactjs.org/docs/hooks-reference.html\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://reactjs.org/docs/hooks-intro.html#motivation\", \"href\": \"https://reactjs.org/docs/hooks-intro.html#motivation\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"url\": \"https://reactjs.org/docs/hooks-rules.html\", \"href\": \"https://reactjs.org/docs/hooks-rules.html\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,0,0,0,0,0,'2021-12-21 12:51:19','2021-12-21 12:51:19',NULL,NULL,NULL,NULL,NULL,'live'),(180,1,'fc5775a0-625d-11ec-9947-9c7bef452e53','My Dog','It\'s impossible to pick favorites when it comes to dogs. Every single one of them deserves the title of man\'s best friend, and every single one of them deserves a life full of love, cuddles, and lots','{\"blocks\": [{\"key\": \"90s40\", \"data\": {}, \"text\": \"It\'s impossible to pick favorites when it comes to dogs. Every single one of them deserves the title of man\'s best friend, and every single one of them deserves a life full of love, cuddles, and lots and lots of toys. As dog lovers, it\'s difficult to rank the cutest dog breeds. After all, what do you prioritize first? The paws? The ears? Something else? Everyone has a different opinion on the matter.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 4, \"offset\": 212}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://www.goodhousekeeping.com/life/pets/g5121/best-dog-toys/\", \"href\": \"https://www.goodhousekeeping.com/life/pets/g5121/best-dog-toys/\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,0,0,0,0,0,'2021-12-21 13:00:34','2021-12-21 13:00:34',NULL,NULL,NULL,NULL,NULL,'live'),(181,1,'33a3289e-625e-11ec-9947-9c7bef452e53','Your Dog','Loyal, protective, and always happy to see you, the dog has been a human companion for more than 18,000 years, making it one of the first domesticated animals in history.\nDon\'t just take our word for','{\"blocks\": [{\"key\": \"c77nj\", \"data\": {}, \"text\": \"Loyal, protective, and always happy to see you, the dog has been a human companion for more than 18,000 years, making it one of the first domesticated animals in history.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"d5msb\", \"data\": {}, \"text\": \"Don\'t just take our word for it.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 13:02:07','2021-12-21 13:02:07',NULL,NULL,NULL,NULL,NULL,'live'),(182,1,'9465e050-625e-11ec-9947-9c7bef452e53','Our Puppy','I am creating a webpage with a few private routes. If the user is not logged in, I want to redirect them to the home page. If the user is logged in, I want to display the page they were originally try','{\"blocks\": [{\"key\": \"c12ig\", \"data\": {}, \"text\": \"I am creating a webpage with a few private routes. If the user is not logged in, I want to redirect them to the home page. If the user is logged in, I want to display the page they were originally trying to access. The set up I have currently is working for that intended purpose, but whenever a person is on the Private route who is logged in, and then refreshes the page, the private route redirects them to the home page. Unfortunately, my loggedInProvider is running it\'s logged in code AFTER the private route checks the loggedIn boolean and redirects them. SO technically on refresh it is not logging the person in quick enough. Is there a way to wait for the logged in useEffect to run before running the private route code?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"6865g\", \"data\": {}, \"text\": \"Here is the useEffect code in my loggedInContext:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"HIGHLIGHT\", \"length\": 49, \"offset\": 0}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 13:04:49','2021-12-23 15:09:37',NULL,NULL,NULL,NULL,'2021-12-23 15:09:37','live'),(183,1,'b9e7b155-625e-11ec-9947-9c7bef452e53','His Puppy','Loyal, protective, and always happy to see you, the dog has been a human companion for more than 18,000 years, making it one of the first domesticated animals in history.\nDon\'t just take our word for','{\"blocks\": [{\"key\": \"6ogih\", \"data\": {}, \"text\": \"Loyal, protective, and always happy to see you, the dog has been a human companion for more than 18,000 years, making it one of the first domesticated animals in history.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"60j78\", \"data\": {}, \"text\": \"Don\'t just take our word for it.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 13:05:52','2021-12-21 13:05:52',NULL,NULL,NULL,NULL,NULL,'live'),(184,1,'dfe9cba6-6260-11ec-9947-9c7bef452e53','Ortal\'s Puppy','Obviously, our list of the cutest dog breeds is totally subjective and far from exhaustive. However, we think these pups deserve some recognition for being seriously adorable. From corgis and beagles','{\"blocks\": [{\"key\": \"1s21v\", \"data\": {}, \"text\": \"Obviously, our list of the cutest dog breeds is totally subjective and far from exhaustive. However, we think these pups deserve some recognition for being seriously adorable. From corgis and beagles to huskies and setters, these are the cutest dog breeds we wish we could smother with love. Looking for a new pup? Check out our roundups of the best family dogs and the most popular dog breeds too.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 16, \"offset\": 345}, {\"key\": 1, \"length\": 23, \"offset\": 370}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://www.goodhousekeeping.com/life/pets/g5138/best-family-dogs/\", \"href\": \"https://www.goodhousekeeping.com/life/pets/g5138/best-family-dogs/\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://www.goodhousekeeping.com/life/pets/news/g3291/best-dog-breeds/\", \"href\": \"https://www.goodhousekeeping.com/life/pets/news/g3291/best-dog-breeds/\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,0,0,0,0,0,'2021-12-21 13:21:15','2021-12-21 13:21:15',NULL,NULL,NULL,NULL,NULL,'live'),(185,1,'9816c6f3-6262-11ec-9947-9c7bef452e53','kuityku','fxfchgccvcvcvcvcvcv\nfxfchgccvcvcvcvcvcv Commission will discuss','{\"blocks\": [{\"key\": \"a5qdj\", \"data\": {}, \"text\": \"fxfchgccvcvcvcvcvcv\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"9qarm\", \"data\": {}, \"text\": \"fxfchgccvcvcvcvcvcv Commission will discuss\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 20, \"offset\": 0}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 13:33:33','2021-12-23 13:08:54',NULL,NULL,NULL,NULL,'2021-12-23 13:08:54','live'),(186,1,'53261a31-626a-11ec-9947-9c7bef452e53','Sofii\'s Hedgehog','Facts about Hedgehogs\nWhat is special about a hedgehog?\nHedgehogs are cute little critters famous for their prickly spines, which they have everywhere except on their face, legs and bellies. When a he','{\"blocks\": [{\"key\": \"fhho7\", \"data\": {}, \"text\": \"Facts about Hedgehogs\", \"type\": \"header-two\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"7c8is\", \"data\": {}, \"text\": \"What is special about a hedgehog?\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"9da9t\", \"data\": {}, \"text\": \"Hedgehogs are cute little critters famous for their prickly spines, which they have everywhere except on their face, legs and bellies. When a hedgehog feels threatened they curl into a tight ball tuck in their heads, tail and legs, to protect vulnerable parts of their body.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"99ipm\", \"data\": {}, \"text\": \"There are 15 different species of hedgehog, found across Europe, Asia and Africa. They can live in a variety of habitats, including deserts, forests and grasslands. The African pygmy hedgehog is the most common species of hedgehog kept as a pet.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"d43id\", \"data\": {}, \"text\": \"How many spikes does a hedgehog have?\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"2l5jm\", \"data\": {}, \"text\": \"Hedgehogs are well known for their prickly spines. The back of a hedgehog is covered in a thick layer of spikes known as quills, and they have between 3,000 to 5,000 quills covering their backs.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"4kovf\", \"data\": {}, \"text\": \"Are hedgehogs smart?\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"92q57\", \"data\": {}, \"text\": \"The intelligence of a hedgehog is to that of a hamster, they may learn certain behaviors through positive reinforcement or conditioning but only at a very basic level.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"e146u\", \"data\": {}, \"text\": \"Hedgehogs are known to be very communicative when it comes to their needs, and often make a low purring sound when they are happy or content.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"8patr\", \"data\": {}, \"text\": \"Are hedgehogs cuddly?\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-21 14:28:54','2021-12-21 14:28:54',NULL,NULL,NULL,NULL,'2021-12-21 14:28:54','live'),(196,1,'776e60d2-6306-11ec-9947-9c7bef452e53','string','string','{}',0,0,0,0,0,0,'2021-12-22 09:06:36','2021-12-22 14:43:39','string','string','string','string','2021-12-22 09:06:36','dead'),(197,1,'b3b3e154-6306-11ec-9947-9c7bef452e53','Why Not Try Something New','Rendering Process Overview\nDuring the rendering process, React will start at the root of the component tree and loop downwards to find all components that have been flagged as needing updates. For eac','{\"blocks\": [{\"key\": \"fnrqe\", \"data\": {}, \"text\": \"Rendering Process Overview\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"a2ad8\", \"data\": {}, \"text\": \"During the rendering process, React will start at the root of the component tree and loop downwards to find all components that have been flagged as needing updates. For each flagged component, React will call either classComponentInstance.render() (for class components) or FunctionComponent() (for function components), and save the render output.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 31, \"offset\": 217}, {\"style\": \"CODE\", \"length\": 19, \"offset\": 275}]}, {\"key\": \"ddvn7\", \"data\": {}, \"text\": \"A component\'s render output is normally written in JSX syntax, which is then converted to React.createElement() calls as the JS is compiled and prepared for deployment. createElement returns React elements, which are plain JS objects that describe the intended structure of the UI. Example:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 21, \"offset\": 90}, {\"style\": \"CODE\", \"length\": 13, \"offset\": 169}, {\"style\": \"ITALIC\", \"length\": 8, \"offset\": 197}]}], \"entityMap\": {}}',0,0,0,0,0,0,'2021-12-22 09:08:17','2021-12-22 14:42:38',NULL,NULL,NULL,NULL,'2021-12-22 09:08:17','live'),(198,1,'fce2ca01-6306-11ec-9947-9c7bef452e53','Another Hedgehog','Rendering Process Overview\nDuring the rendering process, React will start at the root of the component tree and loop downwards to find all components that have been flagged as needing updates. For eac','{\"blocks\": [{\"key\": \"7tfjt\", \"data\": {}, \"text\": \"Rendering Process Overview\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"bave\", \"data\": {}, \"text\": \"During the rendering process, React will start at the root of the component tree and loop downwards to find all components that have been flagged as needing updates. For each flagged component, React will call either classComponentInstance.render() (for class components) or FunctionComponent() (for function components), and save the render output.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 31, \"offset\": 217}, {\"style\": \"CODE\", \"length\": 19, \"offset\": 275}]}, {\"key\": \"5ev9k\", \"data\": {}, \"text\": \"A component\'s render output is normally written in JSX syntax, which is then converted to React.createElement() calls as the JS is compiled and prepared for deployment. createElement returns React elements, which are plain JS objects that describe the intended structure of the UI. Example:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 21, \"offset\": 90}, {\"style\": \"CODE\", \"length\": 13, \"offset\": 169}, {\"style\": \"ITALIC\", \"length\": 8, \"offset\": 197}]}], \"entityMap\": {}}',0,0,0,0,0,0,'2021-12-22 09:10:20','2021-12-22 14:37:23',NULL,NULL,NULL,NULL,'2021-12-22 09:10:20','live'),(199,1,'825132f3-6307-11ec-9947-9c7bef452e53','The Newest One','Render and Commit Phases\nThe React team divides this work into two phases, conceptually:\nThe \"Render phase\" contains all the work of rendering components and calculating changes\nThe \"Commit phase\" is','{\"blocks\": [{\"key\": \"1rn96\", \"data\": {}, \"text\": \"Render and Commit Phases\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"b7p7k\", \"data\": {}, \"text\": \"The React team divides this work into two phases, conceptually:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"9p12v\", \"data\": {}, \"text\": \"The \\\"Render phase\\\" contains all the work of rendering components and calculating changes\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"95fkj\", \"data\": {}, \"text\": \"The \\\"Commit phase\\\" is the process of applying those changes to the DOM\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"7gj90\", \"data\": {}, \"text\": \"After React has updated the DOM in the commit phase, it updates all refs accordingly to point to the requested DOM nodes and component instances. It then synchronously runs the componentDidMount and componentDidUpdate class lifecycle methods, and the useLayoutEffect hooks.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 17, \"offset\": 177}, {\"style\": \"CODE\", \"length\": 18, \"offset\": 199}, {\"style\": \"CODE\", \"length\": 15, \"offset\": 251}]}, {\"key\": \"8ge0q\", \"data\": {}, \"text\": \"React then sets a short timeout, and when it expires, runs all the useEffect hooks. This step is also known as the \\\"Passive Effects\\\" phase.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 9, \"offset\": 67}]}, {\"key\": \"emqvq\", \"data\": {}, \"text\": \"You can see a visualization of the class lifecycle methods in this excellent React lifecycle methods diagram. (It does not currently show the timing of effect hooks, which is something I\'d like to see added.)\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 46, \"offset\": 62}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://projects.wojtekmaj.pl/react-lifecycle-methods-diagram/\", \"href\": \"https://projects.wojtekmaj.pl/react-lifecycle-methods-diagram/\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',0,0,0,0,0,0,'2021-12-22 09:14:04','2021-12-22 14:35:58',NULL,NULL,NULL,NULL,'2021-12-22 09:14:04','live'),(200,1,'c3ba4895-6307-11ec-9947-9c7bef452e53','No hedgehogs in Ramat Gan','What does useEffect do? By using this Hook, you tell React that your component needs to do something after render. React will remember the function you passed (we’ll refer to it as our “effect”), and','{\"blocks\": [{\"key\": \"6bu3f\", \"data\": {}, \"text\": \"What does useEffect do? By using this Hook, you tell React that your component needs to do something after render. React will remember the function you passed (we’ll refer to it as our “effect”), and call it later after performing the DOM updates. In this effect, we set the document title, but we could also perform data fetching or call some other imperative API.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 23, \"offset\": 0}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 10}]}, {\"key\": \"8gua6\", \"data\": {}, \"text\": \"Why is useEffect called inside a component? Placing useEffect inside the component lets us access the count state variable (or any props) right from the effect. We don’t need a special API to read it — it’s already in the function scope. Hooks embrace JavaScript closures and avoid introducing React-specific APIs where JavaScript already provides a solution.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 43, \"offset\": 0}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 7}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 52}, {\"style\": \"CODE\", \"length\": 5, \"offset\": 102}]}, {\"key\": \"6cep6\", \"data\": {}, \"text\": \"Does useEffect run after every render? Yes! By default, it runs both after the first render and after every update. (We will later talk about how to customize this.) Instead of thinking in terms of “mounting” and “updating”, you might find it easier to think that effects happen “after render”. React guarantees the DOM has been updated by the time it runs the effects.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 21, \"offset\": 142}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 38, \"offset\": 0}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 5}, {\"style\": \"ITALIC\", \"length\": 3, \"offset\": 92}]}, {\"key\": \"8icks\", \"data\": {}, \"text\": \"\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://reactjs.org/docs/hooks-effect.html#tip-optimizing-performance-by-skipping-effects\", \"href\": \"https://reactjs.org/docs/hooks-effect.html#tip-optimizing-performance-by-skipping-effects\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',0,0,0,0,0,0,'2021-12-22 09:15:54','2021-12-22 14:33:23',NULL,NULL,NULL,NULL,'2021-12-22 09:15:54','live'),(201,1,'338bd792-6308-11ec-9947-9c7bef452e53','No Hedgehogs in TLV Either','What does useEffect do? By using this Hook, you tell React that your component needs to do something after render. React will remember the function you passed (we’ll refer to it as our “effect”), and','{\"blocks\": [{\"key\": \"ftm6r\", \"data\": {}, \"text\": \"What does useEffect do? By using this Hook, you tell React that your component needs to do something after render. React will remember the function you passed (we’ll refer to it as our “effect”), and call it later after performing the DOM updates. In this effect, we set the document title, but we could also perform data fetching or call some other imperative API.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 23, \"offset\": 0}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 10}]}, {\"key\": \"3uerq\", \"data\": {}, \"text\": \"Why is useEffect called inside a component? Placing useEffect inside the component lets us access the count state variable (or any props) right from the effect. We don’t need a special API to read it — it’s already in the function scope. Hooks embrace JavaScript closures and avoid introducing React-specific APIs where JavaScript already provides a solution.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 43, \"offset\": 0}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 7}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 52}, {\"style\": \"CODE\", \"length\": 5, \"offset\": 102}]}, {\"key\": \"2s75p\", \"data\": {}, \"text\": \"Does useEffect run after every render? Yes! By default, it runs both after the first render and after every update. (We will later talk about how to customize this.) Instead of thinking in terms of “mounting” and “updating”, you might find it easier to think that effects happen “after render”. React guarantees the DOM has been updated by the time it runs the effects.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 21, \"offset\": 142}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 38, \"offset\": 0}, {\"style\": \"CODE\", \"length\": 9, \"offset\": 5}, {\"style\": \"ITALIC\", \"length\": 3, \"offset\": 92}]}, {\"key\": \"7vste\", \"data\": {}, \"text\": \"\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://reactjs.org/docs/hooks-effect.html#tip-optimizing-performance-by-skipping-effects\", \"href\": \"https://reactjs.org/docs/hooks-effect.html#tip-optimizing-performance-by-skipping-effects\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',0,0,0,0,0,0,'2021-12-22 09:19:01','2021-12-22 14:23:18',NULL,NULL,NULL,NULL,'2021-12-22 09:19:01','live'),(202,1,'b001aabd-630a-11ec-9947-9c7bef452e53','Sofii\'s','Use encodeURIComponent() on user-entered fields from forms POST\'d to the server. This will encode & symbols that may inadvertently be generated during data entry for special HTML entities or other cha','{\"blocks\": [{\"key\": \"68i39\", \"data\": {}, \"text\": \"Use encodeURIComponent() on user-entered fields from forms POST\'d to the server. This will encode & symbols that may inadvertently be generated during data entry for special HTML entities or other characters that require encoding/decoding.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 4, \"offset\": 59}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 20, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 4, \"offset\": 59}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 98}]}, {\"key\": \"csega\", \"data\": {}, \"text\": \"For example, if a user writes Jack & Jill, the text may get encoded as Jack &amp; Jill. Without encodeURIComponent() the ampersand could be interpreted on the server as the start of a new field and jeopardize the integrity of the data.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 11, \"offset\": 30}, {\"style\": \"CODE\", \"length\": 15, \"offset\": 71}, {\"style\": \"CODE\", \"length\": 20, \"offset\": 96}]}, {\"key\": \"b72f0\", \"data\": {}, \"text\": \"For application/x-www-form-urlencoded, spaces are to be replaced by +, so one may wish to follow a encodeURIComponent() replacement with an additional replacement of %20 with +.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 33, \"offset\": 4}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 33, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 68}, {\"style\": \"CODE\", \"length\": 20, \"offset\": 99}, {\"style\": \"CODE\", \"length\": 3, \"offset\": 166}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 175}]}, {\"key\": \"tmd2\", \"data\": {}, \"text\": \"To be more stringent in adhering to RFC 3986 (which reserves !, \', (, ), and *), even though these characters have no formalized URI delimiting uses, the following can be safely used:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 2, \"length\": 8, \"offset\": 36}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://developer.mozilla.org/en-US/docs/Web/HTTP/Methods/POST\", \"href\": \"https://developer.mozilla.org/en-US/docs/Web/HTTP/Methods/POST\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"rel\": \" noopener\", \"url\": \"https://www.whatwg.org/specs/web-apps/current-work/multipage/association-of-controls-and-forms.html#application/x-www-form-urlencoded-encoding-algorithm\", \"href\": \"https://www.whatwg.org/specs/web-apps/current-work/multipage/association-of-controls-and-forms.html#application/x-www-form-urlencoded-encoding-algorithm\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"rel\": \" noopener\", \"url\": \"https://datatracker.ietf.org/doc/html/rfc3986\", \"href\": \"https://datatracker.ietf.org/doc/html/rfc3986\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',0,0,0,0,0,0,'2021-12-22 09:36:49','2021-12-22 14:16:30',NULL,NULL,NULL,NULL,'2021-12-22 11:19:29','live'),(203,1,'8919258e-6311-11ec-9947-9c7bef452e53','Todays\' Cat','What does useEffect do? By using this Hook, you tell React that your component needs to do something after render. React will remember the function you passed (we’ll refer to it as our “effect”), and','{\"blocks\": [{\"key\": \"5flte\", \"data\": {}, \"text\": \"Use encodeURIComponent() on user-entered fields from forms POST\'d to the server. This will encode & symbols that may inadvertently be generated during data entry for special HTML entities or other characters that require encoding/decoding.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 4, \"offset\": 59}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 20, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 4, \"offset\": 59}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 98}]}, {\"key\": \"3i46b\", \"data\": {}, \"text\": \"For example, if a user writes Jack & Jill, the text may get encoded as Jack &amp; Jill. Without encodeURIComponent() the ampersand could be interpreted on the server as the start of a new field and jeopardize the integrity of the data.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 11, \"offset\": 30}, {\"style\": \"CODE\", \"length\": 15, \"offset\": 71}, {\"style\": \"CODE\", \"length\": 20, \"offset\": 96}]}, {\"key\": \"6u8ol\", \"data\": {}, \"text\": \"For application/x-www-form-urlencoded, spaces are to be replaced by +, so one may wish to follow a encodeURIComponent() replacement with an additional replacement of %20 with +.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 33, \"offset\": 4}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 33, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 68}, {\"style\": \"CODE\", \"length\": 20, \"offset\": 99}, {\"style\": \"CODE\", \"length\": 3, \"offset\": 166}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 175}]}, {\"key\": \"batsh\", \"data\": {}, \"text\": \"To be more stringent in adhering to RFC 3986 (which reserves !, \', (, ), and *), even though these characters have no formalized URI delimiting uses, the following can be safely used:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 2, \"length\": 8, \"offset\": 36}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://developer.mozilla.org/en-US/docs/Web/HTTP/Methods/POST\", \"href\": \"https://developer.mozilla.org/en-US/docs/Web/HTTP/Methods/POST\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"rel\": \" noopener\", \"url\": \"https://www.whatwg.org/specs/web-apps/current-work/multipage/association-of-controls-and-forms.html#application/x-www-form-urlencoded-encoding-algorithm\", \"href\": \"https://www.whatwg.org/specs/web-apps/current-work/multipage/association-of-controls-and-forms.html#application/x-www-form-urlencoded-encoding-algorithm\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"rel\": \" noopener\", \"url\": \"https://datatracker.ietf.org/doc/html/rfc3986\", \"href\": \"https://datatracker.ietf.org/doc/html/rfc3986\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',0,0,0,0,0,0,'2021-12-22 10:25:50','2021-12-22 14:11:03',NULL,NULL,NULL,NULL,'2021-12-22 11:18:43','live'),(204,1,'ba80e2cd-631a-11ec-9947-9c7bef452e53','Rain Over','\"Rain Over Me\" is a song by Cuban-American rapper Pitbull from his sixth studio album, Planet Pit. It features vocals from Puerto Rican-American singer Marc Anthony. The Eurodance song was written by','{\"blocks\": [{\"key\": \"bg3uo\", \"data\": {}, \"text\": \"\\\"Rain Over Me\\\" is a song by Cuban-American rapper Pitbull from his sixth studio album, Planet Pit. It features vocals from Puerto Rican-American singer Marc Anthony. The Eurodance song was written by Pitbull, RedOne, Marc Anthony, Bilal \\\"The Chef\\\" Hajji, AJ Janussi and Rachid \\\"Rush\\\" Aziz. It was also produced by RedOne, Rush and Jimmy Joker. It was released on June 10, 2011, as the third promotional single from the album and received a full release as the album\'s third official single on July 19, 2011.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 14, \"offset\": 28}, {\"key\": 1, \"length\": 7, \"offset\": 50}, {\"key\": 2, \"length\": 10, \"offset\": 87}, {\"key\": 3, \"length\": 12, \"offset\": 152}, {\"key\": 4, \"length\": 9, \"offset\": 170}, {\"key\": 5, \"length\": 6, \"offset\": 209}, {\"key\": 6, \"length\": 22, \"offset\": 231}, {\"