es told \\\"Globes,\\\" The Tel Aviv District Planning and Building Commission will discuss  Commission will discuss bvbn \", \"type\": \"article\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-23 10:44:49','2021-12-23 13:12:03',NULL,NULL,NULL,NULL,'2021-12-23 13:12:03','live'),(226,1,'a35efbfd-63ee-11ec-9947-9c7bef452e53','A Draft Just for You','The floods earlier this month have made discussions about redirecting Tel Aviv\'s Ayalon river more urgent.\nThe Tel Aviv District Planning and Building Commission will discuss today a plan for an under','{\"blocks\": [{\"key\": \"40frv\", \"data\": {}, \"text\": \"The floods earlier this month have made discussions about redirecting Tel Aviv\'s Ayalon river more urgent.\", \"type\": \"header-two\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"9loeh\", \"data\": {}, \"text\": \"The Tel Aviv District Planning and Building Commission will discuss today a plan for an underground pipeline to carry water from the Ayalon River to the Givat Aliya shore in Jaffa. The plan is officially attributed to an initiative by the National Transport Infrastructure Company (Netivei Israel) to add a fourth railway track in the Ayalon riverbed. Sources told \\\"Globes,\\\" however, that the floods in southern Tel Aviv earier this month, which led to the deaths of Stav Harari and Deal Shoshani, acted as a catalyst to bring forward the discussion.\", \"type\": \"article\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-23 12:48:33','2021-12-23 12:48:33',NULL,NULL,NULL,NULL,NULL,'live'),(227,1,'594358d0-63fe-11ec-9947-9c7bef452e53','Before Deploy...','You can use localStorage in order to handle the Authentication. In login function you can set the value of auth state like this localStorage.setItem(\'isAuth\', authenticated). In logout function localS','{\"blocks\": [{\"key\": \"696qq\", \"data\": {}, \"text\": \"You can use localStorage in order to handle the Authentication. In login function you can set the value of auth state like this localStorage.setItem(\'isAuth\', authenticated). In logout function localStorage.removeItem(\'isAuth\'). Change the PrivateRoute as per the localStorageYou can use localStorage in order to handle the Authentication. In login function you can set the value of auth state like this localStorage.setItem(\'isAuth\', authenticated). In logout function localStorage.removeItem(\'isAuth\'). Change the PrivateRoute as per the localStorageYou can \", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 12, \"offset\": 12}, {\"style\": \"CODE\", \"length\": 33, \"offset\": 194}, {\"style\": \"CODE\", \"length\": 12, \"offset\": 264}, {\"style\": \"CODE\", \"length\": 12, \"offset\": 288}, {\"style\": \"CODE\", \"length\": 33, \"offset\": 470}, {\"style\": \"CODE\", \"length\": 12, \"offset\": 540}, {\"style\": \"HIGHLIGHT\", \"length\": 12, \"offset\": 12}]}, {\"key\": \"a1016\", \"data\": {}, \"text\": \"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"vd9\", \"data\": {}, \"text\": \"use localStorage in order to handle the Authentication. In login function you can set the value of auth state like this localStorage.setItem(\'isAuth\', authenticated). In logout function localStorage.removeItem(\'isAuth\'). Change the PrivateRoute as per the localStorage\", \"type\": \"blockquote\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 12, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 33, \"offset\": 186}, {\"style\": \"CODE\", \"length\": 12, \"offset\": 256}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-23 14:41:01','2021-12-23 14:41:01',NULL,NULL,NULL,NULL,'2021-12-23 14:41:01','live'),(228,1,'c960ac10-6402-11ec-9947-9c7bef452e53','Yedidia asked','I am creating a webpage with a few private routes. If the user is not logged in, I want to redirect them to the home page. If the user is logged in, I want to display the page they were originally tr','{\"blocks\": [{\"key\": \"d1vhi\", \"data\": {}, \"text\": \"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"413u6\", \"data\": {}, \"text\": \"I am creating a webpage with a few private routes. If the user is not logged in, I want to redirect them to the home page. If the user is logged in, I want to display the page they were originally trying to access. The set up I have currently is working for that intended purpose, but whenever a person is on the Private route who is logged in, and then refreshes the page, the private route redirects them to the home page. Unfortunately, my loggedInProvider is running it\'s logged in code AFTER the private route checks the loggedIn boolean and redirects them. SO technically on refresh it is not logging the person in quick enough. Is there a way to wait for the logged in useEffect to run before running the private route code?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"HIGHLIGHT\", \"length\": 135, \"offset\": 21}]}, {\"key\": \"71nr8\", \"data\": {}, \"text\": \"Here is the useEffect code in my loggedInContext:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 49, \"offset\": 0}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-23 15:12:47','2021-12-23 15:12:47',NULL,NULL,NULL,NULL,'2021-12-23 15:12:47','live');
